import React from 'react';
import Navigation from './components/Navigation'
import './App.css';
import Home from './components/Home';

function App() {
  return (
      <div>
        <div className="App">
          <div>
            <Navigation />
            <code><h1 className="home-name">SHIVESH SHARMA</h1></code>
          </div>   
        </div>   
        <div className="home-content">
          <Home />
        </div>
      </div>

  );
}

export default App;
